  var ShortLink = ''
  const setShortLink = (inputValue) =>{
    console.log(inputValue)
    ShortLink  = inputValue;
    return (
      <div className = "App">
        <InputURL setShortLink = {setShortLink}/>
        <LinkResult ShortLink = {ShortLink}/>
        <BackgroundAnimate />
      </div>
    )
  }



  return (
    <div className = "App">
      <InputURL setShortLink = {setShortLink}/>
      <LinkResult ShortLink = {ShortLink}/>
      <BackgroundAnimate />
    </div>
  )

}

export default App;
